import React from 'react';
import { Icon, Input } from 'semantic-ui-react';



export default class Search extends React.Component {

    constructor(){
        super(props);
    }

    render() {
        return(

            <Input
            icon={<Icon name='search' inverted circular link />}
            placeholder='Search Youtube..'
          />

        );
    }

}
